/**
 * 省市区联动选择JS封装类 Province City Area Selector
 * 
 * 需要jQuery的支持
 * 示例1：
 *     html: <select id="pcasdemo"></select>
 *     js: $('#pcasdemo').pcasDict('pcasaddr'); //默认无选中
 *     js: $('#pcasdemo').pcasDict('pcasaddr', ''); //默认无选中
 *     js: $('#pcasdemo').pcasDict('pcasaddr', '', {}); //默认无选中
 *     js: $('#pcasdemo').pcasDict('pcasaddr', '130429', {}); //默认选中：河北省邯郸市永年县
 *     js: $('#pcasdemo').pcasDict('pcasaddr', '', {select_province: '请选择', select_city: '请选择', select_area: '请选择'});//默认选项，可自行定义
 * 示例2：
 *     html: <select id="pcasdemo" address="130429"></select>
 *     js: $('#pcasdemo').pcasDict('pcasaddr'); //默认选中：河北省邯郸市永年县（基于 address 属性）
 * 通过地址ID值获取真实地址：
 *     $.pcasAddress(130429); //返回：河北省邯郸市永年县
 *     $.pcasAddress(130429, ' '); //返回：河北省 邯郸市 永年县
 *     $.pcasAddress(130429, ','); //返回：河北省,邯郸市,永年县
 * 提示：当 $ 不等于 jQuery 时，请使用 jQuery.
 * 
 * @param {String} name The name of the selector.
 * @param {String} value The value of the selector.
 * @param {Object} options An object literal containing key/value pairs to provide optional cookie attributes.
 * @option {String} select The default option value.
 * @returns {void}
 * @author Changfeng Ji <jichf@qq.com>
 */
(function($){
  $.fn.pcasDict = function(name, value, options){
    if(typeof value === 'undefined'){
      value = '';
    }
	if(value === '' && $(this).attr('address')){
		value = $(this).attr('address');
	}
    value = value.toString();
    var randomint = parseInt(1000000 * Math.random());
    var settings = $.extend({
      select_province: '请选择',
      select_city: '请选择',
      select_area: '请选择'
    }, options || {});
    var self = this;
    $(self).before($('<input type="hidden" id="pcasinput' + randomint + '" />').attr('name', name).val(value).attr('rel', value));
    $(self).addClass('pcas_dict_province').append($('<option></option>').html(settings.select_province));
    $.each(window.pcasDict.provinces, function(i, item){
      $("<option></option>").attr("value", item.code).html(item.name).appendTo($(self));
    });
    $(self).after($('<select id="pcascity' + randomint + '"></select>').addClass('pcas_dict_city').append($('<option></option>').html(settings.select_city)));
    $("#pcascity" + randomint).after($('<select id="pcasarea' + randomint + '"></select>').addClass('pcas_dict_area').append($('<option></option>').html(settings.select_area)));

    $(self).bind("change",function(){//Province
      $("#pcascity" + randomint).unbind('change').empty().append($('<option></option>').html(settings.select_city));
      $("#pcasarea" + randomint).unbind('change').empty().append($('<option></option>').html(settings.select_area));
      if($(self).val() == settings.select_province){
        self.setAreaValue('');
        return;
      }
      self.setAreaValue($(self).val());
      self.createCity(window.pcasDict.cities[$(self).val()]);
    });
    
    self.createCity = function(areas){//City
      $.each(areas, function(i, item){
        $('#pcascity' + randomint).append($("<option></option>").attr("value", item.code).html(item.name));
      });
      $('#pcascity' + randomint).bind("change",function(){
        $('#pcasarea' + randomint).unbind('change').empty().append($('<option></option>').html(settings.select_area));
        if($('#pcascity' + randomint).val() == settings.select_city){
          self.setAreaValue($(self).val());
          return;
        }
        self.setAreaValue($('#pcascity' + randomint).val());
        self.createArea(window.pcasDict.areas[$('#pcascity' + randomint).val()]);
      });
    };
    
    self.createArea = function(areas){//Area
      $.each(areas, function(i, item){
        $('#pcasarea' + randomint).append($("<option></option>").attr("value", item.code).html(item.name));
      });
      $('#pcasarea' + randomint).bind("change",function(){
        if($('#pcasarea' + randomint).val() == settings.select_area){
          self.setAreaValue($('#pcascity' + randomint).val());
          return;
        }
        self.setAreaValue($('#pcasarea' + randomint).val());
      });
    };
    
    self.setAreaValue = function(value){
      $('#pcasinput' + randomint).attr('value', value);
      $('#pcasinput' + randomint).attr('rel', $.pcasAddress(value));
    };

    if(value != ""){
      if($(self).find('option[value=' + value.substr(0, 2) + '0000]').length > 0){
        $(self).find('option[value=' + value.substr(0, 2) + '0000]').attr("selected", "selected");
        $(self).change();
      }
      if($('#pcascity' + randomint).find('option[value=' + value.substr(0, 4) + '00]').length > 0){
        $('#pcascity' + randomint).find('option[value=' + value.substr(0, 4) + '00]').attr("selected", "selected");
        $('#pcascity' + randomint).change();
      }
      if($('#pcasarea' + randomint).find('option[value=' + value + ']').length > 0){
        $('#pcasarea' + randomint).find('option[value=' + value + ']').attr("selected", "selected");
        $('#pcasarea' + randomint).change();
      }
    }
  };
  $.extend({
    pcasAddress: function(value, separator){
      value = value.toString();
      if(typeof separator === 'undefined'){
        separator = '';
      }
      var provinceId = value.substr(0, 2) + '0000';
      var cityId = value.substr(0, 4) + '00';
      var areaId = value;
      var address = [];
      $.each(window.pcasDict.provinces, function(i, item){
        if(item.code == provinceId){
          address.push(item.name);
          return false;
        }
      });
      if(window.pcasDict.cities[provinceId]){
        $.each(window.pcasDict.cities[provinceId], function(i, item){
          if(item.code == cityId){
            address.push(item.name);
            return false;
          }
        });
      }
      if(window.pcasDict.areas[cityId]){
        $.each(window.pcasDict.areas[cityId], function(i, item){
          if(item.code == areaId){
            address.push(item.name);
            return false;
          }
        });
      }
      return address.join(separator);
    }
  });
})(jQuery);
